import React from "react";
import { Container, Row, Col } from "shards-react";

class Daily extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Container>
        <Row>
          <Col>
            <h1>&#128171; Rating</h1>
          </Col>
        </Row>
        <Row>
          <Col></Col>
        </Row>
      </Container>
    );
  }
}

export default Daily;
